import React from "react";

const DiaryItem = ({ id, author, contents, created_at, emotion }) => {
  return (
    <>
      <div>
        작성자: {author} | 감정점수: {emotion}
      </div>
      <div>{new Date(created_at).toLocaleString()}</div>
      <div>{contents}</div>
    </>
  );
};

export default DiaryItem;
